import * as React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
  TextField,
  FormControlLabel,
} from "@mui/material";
import { useForm } from "react-hook-form";

const CheckoutForm = () => {
  const {
    register,
    handleSubmit,
    watch,
    formState: { errors },
  } = useForm();
  const onSubmit = (data) => console.log(data);

  return (
    <Box className="checkingForm">
      <form className="form" onSubmit={handleSubmit(onSubmit)}>
        {/* <Typography
          gutterBottom
          variant="h6"
          component="div"
          className=""
          style={{
            paddingLeft: "3vw",
            paddingTop: "1vw",
            outline: "none",
            color: "black",
            fontSize: "2.125rem",
          }}
        >
          Checkout
        </Typography> */}
        <TextField
          defaultValue=""
          {...register("example1")}
          id="lastName"
          name="lastName"
          label="Last name"
          fullWidth
          variant="standard"
        />
        <Button variant="contained"  type="submit">Submit</Button>
      </form>
      <form onSubmit={handleSubmit(onSubmit)}>
          <TextField
            id="standard-basic"
            label="Email"
            variant="outlined"
            className="inputLogin"
            defaultValue=""
            {...register("email")}
            // error="true"
            // helperText="this is error"
          />
          <TextField
            id="standard-basic"
            label="Password"
            variant="outlined"
            type="password"
            className="inputLogin"
            defaultValue=""
            {...register("password")}
            // error="true"
            // helperText="this is error"
          />
          <Button variant="contained" className="buttonLogin" type="submit">
            Log In
          </Button>
          <br></br>
          <Typography variant="p" className="registerText">
            Do you have account ?
            <Link href="/register" className="registerLink">
              Register
            </Link>
          </Typography>
        </form>
    </Box>
  );
};

export default CheckoutForm;
